(161, 4, 'how_it_works_title', 'how it works'),
(162, 4, '_how_it_works_title', 'field_585777510e452'),
(163, 4, 'how_it_works_content', '<p>Real Management Services adds your name as an Authorized User (AU) on one of our low balance credit cards that have perfect payment history. An AU is an individual that does not have access to the account, cannot make changes to it, nor have the responsibility to repay any amount that might be owed. The original intent of the AU designation was to give Primary Cardholders the ability to add their children, spouses, friends or employees to their accounts, effectively giving them access to the available credit line by use of an Authorized User credit card. Without that card the user isn’t even able to spend money on the credit account. An incidental benefit that occurs during this process is that the account history for that credit card appears on the AU’s (your) credit report; it looks like that credit card’s history has been there since the account was first opened. This "incidental benefit" gives you an immediate FICO® credit score boost.\r\n<br /><br />\r\nAlthough you do not receive the physical card or ability to use the credit line, you will receive the amazing benefit of having that particular credit card’s credit history appear on your credit report. This extreme increase in the limit to balance (utilization) ratio and overall average age of the revolving accounts on your credit report gives you the biggest possible FICO® score boost in less than 60 days; and it''s guaranteed!</p>\r\n<br />\r\n<a href="http://localhost:8888/clients/">find out more</a>'),
(164, 4, '_how_it_works_content', 'field_5857785e0e453'),
(165, 4, 'take_advantage_content', '<p>Take advantage of this great benefit! </p>\r\n<h2>1-888-412-9634</h2>'),
(166, 4, '_take_advantage_content', 'field_58577993c47df'),
(167, 4, 'how_to_make_money_content', '<h2>how to make money</h2>\r\n<p>Use your good credit to earn extra <span>cash!</span></p>'),
(168, 4, '_how_to_make_money_content', 'field_58577acb61173'),
(169, 4, 'become_a_cardholder_content', '<h3>Become a Cardholder</h3>\r\n<p>We pay Cardholders just like you a fee for adding our clients as Authorized Users (AU) to their credit cards. The Authorizer User does not have access to spend money from your account - they don not know who you are - and they are paying ONLY for the benefit of seeing your credit card''s payment history appear on their credit report.</p><br />\r\n<a href="http://localhost:8888/cardholders/">get started</a>'),
(170, 4, '_become_a_cardholder_content', 'field_58577aef61174'),
(171, 4, 'become_a_broker_content', '<h3>Become a Broker</h3>\r\n<p>Do you own your own business? Do you want to? Real Management Services offers individuals the opportunity to become a resellers of our service! Receive a discount pricing on our tradelines. Receive a copy of all of our disclosures and contracts with YOUR COMPANY NAME on them.</p><br />\r\n<a href="http://localhost:8888/broker/">Start Earning Money Today</a>'),
(172, 4, '_become_a_broker_content', 'field_58577b1661175'),
