(213, 49, '_become_a_cardholder_content', 'field_58577aef61174'),
(214, 49, 'become_a_broker_content', '<h3>Become a Broker</h3>\r\n<p>Do you own your own business? Do you want to? Real Management Services offers individuals the opportunity to become a resellers of our service! Receive a discount pricing on our tradelines. Receive a copy of all of our disclosures and contracts with YOUR COMPANY NAME on them.</p><br />\r\n<a href="#">Start Earning Money Today</a>'),
(215, 49, '_become_a_broker_content', 'field_58577b1661175'),
