(307, 77, '_section_6', 'field_58590588f2c3b'),
(308, 77, 'section_7', '<h3>How it Benefits</h3>\r\n<p>Through a method known as “credit piggybacking,” RMS adds you as an Authorized User (AU) to one or more high limit, low balance, seasoned credit cards, which drastically improves your credit score rapidly! While you do not receive the physical card or ability to use the credit line, you will receive the amazing benefit of having that particular credit card “copied and pasted” on to your credit report. This extreme increase in the limit to balance (utilization) ratio and overall average age of the revolving accounts on your credit report gives you the biggest possible FICO® score boost in 60 days or less, guaranteed! To learn more about how your credit works, and how piggybacking can boost your credit score, click the button below.</p><br />\r\n<a href="#">learn more</a>'),
(309, 77, '_section_7', 'field_58590586f2c3a'),
(310, 77, 'section_8', '<h3>How It’s Legal</h3>\r\n<p>RMS has commissioned extensive research into the legality of “piggybacking”. Multiple law firms, the Federal Reserve Bank, the Federal Trade Commission, and various Attorneys General have all looked into the practice in fine detail, and each have determined that the act of paying someone to add another person to their existing credit card account as an Authorized User is perfectly legal. While the banks and credit reporting agencies may dislike the practice, credit piggybacking is actually protected by Regulation B of the Equal Credit Opportunity Act. To learn more about these legal opinions, click the button below.\r\n</p>'),
