(555, 102, 'ch_section_2', '<img src="http://localhost:8888/wp-content/uploads/2016/12/doc_check.png" />\r\n<p>Don’t you wish you could GET PAID for your<br />\r\ngreat credit history without Going into debt?</p>\r\n<h3>NOW YOU CAN</h3>'),
(556, 102, '_ch_section_2', 'field_585a4d140a360'),
(557, 102, 'ch_section_3', '<img src="http://localhost:8888/wp-content/uploads/2016/12/federal.png" />\r\n<p><span>Credit Leasing </span><br /> has been acknowledged by the <b>Federal Reserve</b></p>\r\n<br style="clear:both" />\r\n<br />\r\n<p>Essentially, RMS aims to partner with individuals that have great credit history just LIKE YOU and offers you the opportunity to earn extra income...</p>\r\n<br />\r\n<p style=" float: left;margin-top: 20px;">WITHOUT </p><img src="http://localhost:8888/wp-content/uploads/2016/12/arrows.png" />\r\n<p>putting your credit at risk in any way</p>\r\n<p>going into debt</p\r\n<p>selling of any kind</p>'),
(558, 102, '_ch_section_3', 'field_585a4d410a361'),
(559, 102, 'ch_section_4', '<p>Introducing the </p>\r\n<h4>Credit Leasing Program</h4>\r\n<p>Flip the script on your credit card company by making your perfect credit history work for you. You can make extra income to help pay bills without increasing your debt. <br />\r\nYou''ve been a good steward of your credit over time and kept it perfect. Now it''s time to cash in on the benefit of this little known tool ("credit leasing") with zero risk to your credit score.<br />\r\nCredit Leasing (or ''piggybacking'') is a safe, secure way for individuals with good credit to access an additional stream of income by "leasing" the authorized user spots on their credit cards to individuals who seek to enhance their credit.</p>'),
(560, 102, '_ch_section_4', 'field_585a4d9a0a362'),
(561, 102, 'ch_section_5', '<h4>Key Facts about the program</h4>\r\n<ul>\r\n<li><img src="http://localhost:8888/wp-content/uploads/2016/12/icon1.png" />\r\n<p>Who Is It For? </p>\r\n<ul>\r\n<li>Have good credit?</li>\r\n<li>Seeking addt''l income w/o addt''l debt?</li>\r\n<li>Open to a safe, secure way to help others?</li>\r\n</ul>\r\n</li>\r\n<li><img src="http://localhost:8888/wp-content/uploads/2016/12/icon2.png" />\r\n<p>Who Is It For? </p>\r\n<ul>\r\n<li>Have good credit?</li>\r\n<li>Seeking addt''l income w/o addt''l debt?</li>\r\n<li>Open to a safe, secure way to help others?</li>\r\n</ul>\r\n</li>\r\n<li><img src="http://localhost:8888/wp-content/uploads/2016/12/icon3.png" />\r\n<p>Who Is It For? </p>\r\n<ul>\r\n<li>Have good credit?</li>\r\n<li>Seeking addt''l income w/o addt''l debt?</li>\r\n<li>Open to a safe, secure way to help others?</li>\r\n</ul>\r\n</li>\r\n</ul>'),
