(827, 130, 'the_process_content', '<h2>the process</h2>\r\n<ul>\r\n<li><img src="http://localhost:8888/wp-content/uploads/2016/12/card.png" /><p>Browse All Tradelines</p></li>\r\n<li><img src="http://localhost:8888/wp-content/uploads/2016/12/circle.png" /><p>Make Your Selection</p></li>\r\n<li><img src="http://localhost:8888/wp-content/uploads/2016/12/file.png" /><p>Submit Your Boost From</p></li>\r\n<li><img src="http://localhost:8888/wp-content/uploads/2016/12/phone.png" /><p>Receive Verification Call</p></li>\r\n<li><img src="http://localhost:8888/wp-content/uploads/2016/12/dollar.png" /><p>Make Payment</p></li>\r\n<li><img src="http://localhost:8888/wp-content/uploads/2016/12/lappy.png" /><p>Complete Online Profile</p></li>\r\n<li><img src="http://localhost:8888/wp-content/uploads/2016/12/shakehand.png" /><p>Wait For Your Boost</p></li>\r\n</ul>'),
(828, 130, '_the_process_content', 'field_58577958c47de'),
(829, 130, 'how_it_works_title', 'how it works'),
(830, 130, '_how_it_works_title', 'field_585777510e452'),
(831, 130, 'how_it_works_content', '<p>Real Management Services adds your name as an Authorized User (AU) on one of our low balance credit cards that have perfect payment history. An AU is an individual that does not have access to the account, cannot make changes to it, nor have the responsibility to repay any amount that might be owed. The original intent of the AU designation was to give Primary Cardholders the ability to add their children, spouses, friends or employees to their accounts, effectively giving them access to the available credit line by use of an Authorized User credit card. Without that card the user isn’t even able to spend money on the credit account. An incidental benefit that occurs during this process is that the account history for that credit card appears on the AU’s (your) credit report; it looks like that credit card’s history has been there since the account was first opened. This "incidental benefit" gives you an immediate FICO® credit score boost.\r\n<br /><br />\r\nAlthough you do not receive the physical card or ability to use the credit line, you will receive the amazing benefit of having that particular credit card’s credit history appear on your credit report. This extreme increase in the limit to balance (utilization) ratio and overall average age of the revolving accounts on your credit report gives you the biggest possible FICO® score boost in less than 60 days; and it''s guaranteed!</p>\r\n<br /><br />\r\n<a href="http://localhost:8888/clients/">find out more</a>'),
(832, 130, '_how_it_works_content', 'field_5857785e0e453'),
(833, 130, 'take_advantage_content', '<p>Take advantage of this great benefit! </p>\r\n<h2>1-888-412-9634</h2>'),
(834, 130, '_take_advantage_content', 'field_58577993c47df'),
(835, 130, 'how_to_make_money_content', '<h2>how to make money</h2>\r\n<p>Use your good credit to earn extra <span>cash!</span></p>'),
(836, 130, '_how_to_make_money_content', 'field_58577acb61173'),
(837, 130, 'become_a_cardholder_content', '<h3>Become a Cardholder</h3>\r\n<p>We pay Cardholders just like you a fee for adding our clients as Authorized Users (AU) to their credit cards. The Authorizer User does not have access to spend money from your account - they don not know who you are - and they are paying ONLY for the benefit of seeing your credit card''s payment history appear on their credit report.</p><br />\r\n<a href="#">get started</a>'),
(838, 130, '_become_a_cardholder_content', 'field_58577aef61174'),
(839, 130, 'become_a_broker_content', '<h3>Become a Broker</h3>\r\n<p>Do you own your own business? Do you want to? Real Management Services offers individuals the opportunity to become a resellers of our service! Receive a discount pricing on our tradelines. Receive a copy of all of our disclosures and contracts with YOUR COMPANY NAME on them.</p><br />\r\n<a href="#">Start Earning Money Today</a>'),
