(1171, 124, 'section_1', '<h3>Become a Tradeline Broker</h3>\r\n<p>Would you like to take advantage of a wonderful opportunity to own your own business? Real Management Services offers the opportunity for individuals to become resellers of our service. We also extend discount for individuals that purchase 3 or more tradelines within a calendar month! You will receive your own inventory as well as your own personalized order tracking system! </p>\r\n<p><a href="#" class="contactus_lightbox">Contact Us</a> & take advantage of this great opportunity today!</p>'),
(1172, 124, '_section_1', 'field_58590513f2c37'),
(1173, 124, 'section_2', ''),
(1174, 124, '_section_2', 'field_5859058bf2c3f'),
(1175, 124, 'section_3', '<h4>If you would like to be a broker please fill form below</h4>'),
(1176, 124, '_section_3', 'field_5859058af2c3e'),
(1177, 124, 'section_4', '<div class="grey_box">\r\n<p>Once we have your information we will create a replica of our inventory with your business name and phone number. This replicated inventory will have our prices prices your preferred markup.</p>\r\n<br />\r\n<p>Once we send over the assets to you please email us at \r\n<a href="mailto:support@realmanagementservices.net ">support@realmanagementservices.net </a><br />\r\nto schedule an initial conversation <br />\r\nabout the order process.</p>\r\n</div>\r\n<h4>We will discuss:</h4>\r\n<ul>\r\n<li>How you pay us</li>\r\n<li>How to collect & submit orders</li>\r\n<li>Order Notifications</li>\r\n<li>Volume Discounts</li>\r\n</ul>'),
(1178, 124, '_section_4', 'field_5859058af2c3d'),
(1179, 124, 'section_5', ''),
(1180, 124, '_section_5', 'field_58590589f2c3c'),
(1181, 124, 'section_6', '<p>Contact Us Today!</p><p class="contactustodaylink"><a href="http://localhost:8888/tradelines/">Live RMS Tradelines List</a></p>\r\n<h2>1-888-412-9634</h2>'),
(1182, 124, '_section_6', 'field_58590588f2c3b'),
(1183, 124, 'section_7', '<h3>How it Benefits</h3>\r\n<p>Through a method known as “credit piggybacking,” RMS adds you as an Authorized User (AU) to one or more high limit, low balance, seasoned credit cards, which drastically improves your credit score rapidly! While you do not receive the physical card or ability to use the credit line, you will receive the amazing benefit of having that particular credit card “copied and pasted” on to your credit report. This extreme increase in the limit to balance (utilization) ratio and overall average age of the revolving accounts on your credit report gives you the biggest possible FICO® score boost in 60 days or less, guaranteed! To learn more about how your credit works, and how piggybacking can boost your credit score, click the button below.</p><br />\r\n<a href="http://localhost:8888/clients/">learn more</a>'),
(1184, 124, '_section_7', 'field_58590586f2c3a'),
(1185, 124, 'section_8', '<h3>How It’s Legal</h3>\r\n<p>RMS has commissioned extensive research into the legality of “piggybacking”. Multiple law firms, the Federal Reserve Bank, the Federal Trade Commission, and various Attorneys General have all looked into the practice in fine detail, and each have determined that the act of paying someone to add another person to their existing credit card account as an Authorized User is perfectly legal. While the banks and credit reporting agencies may dislike the practice, credit piggybacking is actually protected by Regulation B of the Equal Credit Opportunity Act. To learn more about these legal opinions, click the button below.\r\n</p><br />\r\n<a href="http://localhost:8888/legal-documents-disclosures/">legal papers</a>'),
