(1308, 164, 'section_8', '<h3>How It’s Legal</h3>\r\n<p>RMS has commissioned extensive research into the legality of “piggybacking”. Multiple law firms, the Federal Reserve Bank, the Federal Trade Commission, and various Attorneys General have all looked into the practice in fine detail, and each have determined that the act of paying someone to add another person to their existing credit card account as an Authorized User is perfectly legal. While the banks and credit reporting agencies may dislike the practice, credit piggybacking is actually protected by Regulation B of the Equal Credit Opportunity Act. To learn more about these legal opinions, click the button below.\r\n</p><br />\r\n<a href="http://localhost:8888/legal-documents-disclosures/">legal papers</a>'),
