(1436, 171, 'section_5', '<h3>Legal Documents & Disclosures</h3>\r\n<ul>\r\n<li>Disclosure Statement</li>\r\n<li>User Agreement</li>\r\n<li>Cancellation Form</li>\r\n<li>Credit Repair Organizations Act</li>\r\n<li>Privacy Policy</li>\r\n</ul>\r\n<p>By authorizing Real Management Services to process your payment via electronic check, credit card, debit card, ACH, RCC, or ICL, you extend your authorization to include the transfer of the your personally identifiable information to third parties Real Management Services deems necessary. This personally identifiable and sensitive information will consist of, but is not limited to your name, address, phone number, bank account numbers, and routing numbers will be used to verify your account’s validity, check writing history, and/or account balance(s).</p>\r\n\r\n<h3>Billing Terms</h3>\r\n<p>The Client (you) will remit any and all amounts that are payable to Real Management Services, Inc. (Company) under this agreement on an “Upon Receipt” basis. The client hereby authorizes Real Management Services, Inc. to initiate transaction entries from the client’s checking account for any and all amounts owing to Real Management Services, Inc. under this agreement. Real Management Services, Inc. will attempt to collect all amounts owed by client using the client’s checking account up to four times. Should such collection method fail, client acknowledges that a $50 fee will be assessed for each such failure. In addition, interest will accrue on any past due amounts at the rate of the lesser of one and one-half percent (1.5%) per month or the maximum amount permitted by law. Client shall be liable to the Company for all attorneys’ fees and other costs of collection to collect such unpaid amounts.\r\nEntries initiated to or from the Client’s checking account will be in accordance with the rules set herein. This authorization is to remain in full force and effect until Real Management Services, Inc. has received payment in full for all services rendered, and any applicable recovery fees. If the client’s checking account number changes, the client shall promptly provide Real Management Services, Inc. with written notice of the change and the new number(s). If the client fails to provide Real Management Services, Inc. with accurate current account numbers, Real Management Services, Inc. may discontinue its performance of services for the Client, place their account with a national collection agency, and may seek compensation for loss of use.</p>'),
