(1576, 193, 'section_1', '<h3>Become a Tradeline Broker</h3>\r\n<p>Would you like to take advantage of a wonderful opportunity to own your own business? Real Management Services offers the opportunity for individuals to become resellers of our service. We also extend discount for individuals that purchase 3 or more tradelines within a calendar month! You will receive your own inventory as well as your own personalized order tracking system! </p>\r\n<p><a href="#" class="contactus_lightbox">Contact Us</a> & take advantage of this great opportunity today!</p>'),
