(1785, 222, 'client_section_5', '<h3>How it Benefits</h3>\r\n<p>Through a method known as “credit piggybacking,” RMS adds you as an Authorized User (AU) to one or more high limit, low balance, seasoned credit cards, which drastically improves your credit score rapidly! While you do not receive the physical card or ability to use the credit line, you will receive the amazing benefit of having that particular credit card “copied and pasted” on to your credit report. This extreme increase in the limit to balance (utilization) ratio and overall average age of the revolving accounts on your credit report gives you the biggest possible FICO® score boost in 60 days or less, guaranteed! To learn more about how your credit works, and how piggybacking can boost your credit score, click the button below.</p><br />\r\n<a href="http://localhost:8888/clients/">learn more</a>'),
