(1845, 232, 'section_2', '<h3>Credit Piggybacking</h3>\r\n<p>Please select from the list below, while remembering the three rules to boosting your credit score through Credit Piggybacking:</p>\r\n<ul>\r\n<li>The more credit cards you have us add to your credit report, the bigger the boost will be.</li>\r\n<li>The fewer the number of credit cards currently showing in your credit report as open, the bigger the boost will be.</li>\r\n<li>The higher the limit and older the credit card(s) you choose from the list below, the bigger the boost will be.</li>\r\n</ul>\r\n<p>To purchase the tradelines, you will have to view our live inventory that is updated with every order.Please click the link below to request access.</p>\r\n<br /><br />\r\n<a href="https://docs.google.com/spreadsheets/d/1eoB_WZjqSY4G_5gPc8f_-kgpBIVfNGm9tgysdT7jabI/edit#gid=0" target="_blank"><span>Live RMS Tradelines List</span></a>'),
(1846, 232, '_section_2', 'field_5859058bf2c3f'),
(1847, 232, 'section_3', '<h4>Tradeline Discounts Available!</h4>\r\n<table  cellspacing="0">\r\n    <thead>\r\n        <tr>\r\n            <td>Monthly Tradeline Purchase Volume</td>\r\n            <td>Tradeline Below $550</td>\r\n            <td>Tradeline Over $550</td>\r\n         </tr>\r\n    </thead>\r\n    <tbody>\r\n          <tr>\r\n            <td>1-3</td>\r\n            <td>$0</td>\r\n            <td>$0</td>\r\n          </tr>\r\n          <tr>\r\n            <td>4-10</td>\r\n            <td>$25</td>\r\n            <td>$35</td>\r\n          </tr>\r\n          <tr>\r\n            <td>11-20</td>\r\n            <td>$50</td>\r\n            <td>$70</td>\r\n          </tr>\r\n          <tr>\r\n            <td>21-30</td>\r\n            <td>$75</td>\r\n            <td>$125</td>\r\n          </tr>\r\n          <tr>\r\n            <td>30-50</td>\r\n            <td>$100</td>\r\n            <td>$150</td>\r\n         </tr>\r\n    </tbody>\r\n</table>'),
(1848, 232, '_section_3', 'field_5859058af2c3e'),
(1849, 232, 'section_4', '<h4>Please read Disclaimer on\r\nOrder form before Purchasing</h4><br />\r\n<a href="https://docs.google.com/a/realmanagementservices.net/forms/d/e/1FAIpQLSeIGvJOACjoDJpErSn9YjoJ_xMJ-AZhK7PyeRM19bttfkju1A/viewform" target="_blank"><span><img src="http://localhost:8888/wp-content/uploads/2016/12/file-icon.png" />SSN ORDER FORM</span></a><br /><br />\r\n<p>Here is some advice that financially savvy<br /> \r\ninternet users have to say about <br />\r\npurchasing Authorized User Tradelines?</p><br />\r\n<a href="https://www.nerdwallet.com/blog/credit-cards/credit-card-authorized-users-build-credit/" target="_blank"><span><u>Which Credit Cards Help Authorized Users Build Credit?</u></span></a>'),
(1850, 232, '_section_4', 'field_5859058af2c3d'),
(1851, 232, 'section_5', '<h5>Live RMS Tradeline List</h5>'),
(1852, 232, '_section_5', 'field_58590589f2c3c'),
(1853, 232, 'section_6', '<p>Contact Us Today!</p><p><a href="https://docs.google.com/spreadsheets/d/1eoB_WZjqSY4G_5gPc8f_-kgpBIVfNGm9tgysdT7jabI/edit#gid=0" target="_blank">Live RMS Tradelines List</a></p>\r\n<h2>1-888-412-9634</h2>'),
(1854, 232, '_section_6', 'field_58590588f2c3b'),
(1855, 232, 'section_7', '<h3>How it Benefits</h3>\r\n<p>Through a method known as “credit piggybacking,” RMS adds you as an Authorized User (AU) to one or more high limit, low balance, seasoned credit cards, which drastically improves your credit score rapidly! While you do not receive the physical card or ability to use the credit line, you will receive the amazing benefit of having that particular credit card “copied and pasted” on to your credit report. This extreme increase in the limit to balance (utilization) ratio and overall average age of the revolving accounts on your credit report gives you the biggest possible FICO® score boost in 60 days or less, guaranteed! To learn more about how your credit works, and how piggybacking can boost your credit score, click the button below.</p><br />\r\n<a href="http://localhost:8888/clients/">learn more</a>'),
(1856, 232, '_section_7', 'field_58590586f2c3a'),
(1857, 232, 'section_8', '<h3>How It’s Legal</h3>\r\n<p>RMS has commissioned extensive research into the legality of “piggybacking”. Multiple law firms, the Federal Reserve Bank, the Federal Trade Commission, and various Attorneys General have all looked into the practice in fine detail, and each have determined that the act of paying someone to add another person to their existing credit card account as an Authorized User is perfectly legal. While the banks and credit reporting agencies may dislike the practice, credit piggybacking is actually protected by Regulation B of the Equal Credit Opportunity Act. To learn more about these legal opinions, click the button below.\r\n</p>\r\n<br />\r\n<a href="http://localhost:8888/legal-documents-disclosures/">legal papers</a>'),
(1858, 232, '_section_8', 'field_5859057ff2c39'),
(1859, 232, 'inner_page_header_image', '61'),
