(191, 1, '2016-12-23 11:02:10', '2016-12-23 11:02:10', 'The actual amount by which the credit score can increase is different for everyone. We usually stick to a few rules of thumb when determining the benefits that you will receive:\r\n1. The more low utilization tradelines that you have added to your report, the higher your score will increase.\r\n2. Fewer open credit cards correlate to a bigger boost.\r\n3. Higher limits and older ages for tradelines correlate to bigger boosts.\r\n4. The fewer addresses you have on your credit report, the better.', 'How much will my credit score increase?', '', 'trash', 'closed', 'closed', '', 'how-much-will-my-credit-score-increase__trashed', '', '', '2016-12-24 14:00:34', '2016-12-24 14:00:34', '', 0, 'http://localhost:8888/?post_type=fancyfaq&#038;p=191', 0, 'fancyfaq', '', 0),
