(212, 1, '2016-12-24 14:05:52', '2016-12-24 14:05:52', 'The actual amount by which the credit score can increase is different for everyone. We usually stick to a few rules of thumb when determining the benefits that you will receive:\r\n<ol>\r\n<li>The more low utilization tradelines that you have added to your report, the higher your score will increase.</li>\r\n<li>Fewer open credit cards correlate to a bigger increase.</li>\r\n<li>Higher limits and older ages for tradelines correlate to bigger increases.</li>\r\n<li>The fewer addresses you have on your credit report, the better.</li>\r\n</ol>', 'How much will my credit score increase?', '', 'publish', 'closed', 'closed', '', 'how-much-will-my-credit-score-increase', '', '', '2016-12-24 14:13:25', '2016-12-24 14:13:25', '', 0, 'http://localhost:8888/?post_type=fancyfaq&#038;p=212', 0, 'fancyfaq', '', 0),
(213, 1, '2016-12-24 14:06:21', '2016-12-24 14:06:21', 'We do not repair nor correct credit. We are more than happy to refer you to a credit repair agency.', 'Do you do credit repair/restoration?', '', 'publish', 'closed', 'closed', '', 'do-you-do-credit-repairrestoration', '', '', '2016-12-24 14:06:21', '2016-12-24 14:06:21', '', 0, 'http://localhost:8888/?post_type=fancyfaq&#038;p=213', 0, 'fancyfaq', '', 0),
(214, 1, '2016-12-24 14:07:01', '2016-12-24 14:07:01', 'All lines appear within 20-30 business days from the statement date from the first expected reporting date. If they do not appear within this time period, we will issue a replacement. If the replacement does not post within its time period then we will issue a refund.\r\n\r\nAll lines post within 60 days, most lines post within 30 days, some post within 5 days.', 'How long will it take for the lines to appear on my report?', '', 'publish', 'closed', 'closed', '', 'how-long-will-it-take-for-the-lines-to-appear-on-my-report', '', '', '2016-12-24 14:07:01', '2016-12-24 14:07:01', '', 0, 'http://localhost:8888/?post_type=fancyfaq&#038;p=214', 0, 'fancyfaq', '', 0),
(215, 1, '2016-12-24 14:07:29', '2016-12-24 14:07:29', 'The tradelines will stay on your report for a minimum of two posting cycles. If you would like to extend a tradeline, please let us know by withing 45 days of your purchase.', 'How long will the tradelines stay on my report?', '', 'publish', 'closed', 'closed', '', 'how-long-will-the-tradelines-stay-on-my-report', '', '', '2016-12-24 14:07:29', '2016-12-24 14:07:29', '', 0, 'http://localhost:8888/?post_type=fancyfaq&#038;p=215', 0, 'fancyfaq', '', 0),
(216, 1, '2016-12-24 14:07:52', '2016-12-24 14:07:52', 'An increased credit score is will allow you to secure better interest and approval rates on mortgages, car loans, student loans and other loans in addition to helping you pass background checks for better jobs.', 'What can I do with my increased credit score?', '', 'publish', 'closed', 'closed', '', 'what-can-i-do-with-my-increased-credit-score', '', '', '2016-12-24 14:07:52', '2016-12-24 14:07:52', '', 0, 'http://localhost:8888/?post_type=fancyfaq&#038;p=216', 0, 'fancyfaq', '', 0),
(217, 1, '2016-12-24 14:08:36', '2016-12-24 14:08:36', 'You will be removed from the tradeline after two posting cycles. If you would like to extend a tradeline, please let us know by withing 45 days of your purchase.', 'What happens when the tradeline rental period is over?', '', 'publish', 'closed', 'closed', '', 'what-happens-when-the-tradeline-rental-period-is-over', '', '', '2016-12-24 14:08:36', '2016-12-24 14:08:36', '', 0, 'http://localhost:8888/?post_type=fancyfaq&#038;p=217', 0, 'fancyfaq', '', 0);
INSERT INTO `wprms_posts` (`
ID`,
`post_author
`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES
(218, 1, '2016-12-24 14:09:08', '2016-12-24 14:09:08', 'Once the lender has issued you a rate, they are contractually bound to follow all of the terms of the agreement. Please review your contracts to ensure that you will not be affected.', 'Will the lender change the interest rates once the tradelines fall off my report?', '', 'publish', 'closed', 'closed', '', 'will-the-lender-change-the-interest-rates-once-the-tradelines-fall-off-my-report', '', '', '2016-12-24 14:09:08', '2016-12-24 14:09:08', '', 0, 'http://localhost:8888/?post_type=fancyfaq&#038;p=218', 0, 'fancyfaq', '', 0),
(219, 1, '2016-12-24 14:12:57', '2016-12-24 14:12:57', 'The actual amount by which the credit score can increase is different for everyone. We usually stick to a few rules of thumb when determining the benefits that you will receive:\n<ol>\n<li>The more low utilization tradelines that you have added to your report, the higher your score will increase.\n<li>Fewer open credit cards correlate to a bigger increase.\n<li>Higher limits and older ages for tradelines correlate to bigger increases.\n\nThe fewer addresses you have on your credit report, the better.', 'How much will my credit score increase?', '', 'inherit', 'closed', 'closed', '', '212-autosave-v1', '', '', '2016-12-24 14:12:57', '2016-12-24 14:12:57', '', 212, 'http://localhost:8888/2016/12/24/212-autosave-v1/', 0, 'revision', '', 0),
